INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 106001, 0.0, 1, 0, 7001, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 0, "キャル", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 7002, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 7003, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 0, "ペコリーヌ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 10001, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 0, "ペコリーヌ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 106001, 0.0, 1, 0, 10002, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 0, "キャル", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 10003, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 2, "2030/12/17 14:59:59", 106401, 0.0, 1, 0, 10004, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, 2104010, "シェフィ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 12001, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 0, "ペコリーヌ", -416.5);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 106001, 0.0, 1, 0, 13001, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 0, "キャル", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 13002, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 2, "2030/12/17 14:59:59", 106401, 0.0, 1, 0, 13003, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, 2104010, "シェフィ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 13004, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 0, "ペコリーヌ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 14001, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 2, "2030/12/17 14:59:59", 106401, 0.0, 1, 0, 14002, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, 2104010, "シェフィ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 14003, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 0, "ペコリーヌ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 106001, 0.0, 1, 0, 14004, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 0, "キャル", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 15001, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 0, "コッコロ", -470.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 2, "2030/12/17 14:59:59", 106401, 0.0, 1, 0, 16001, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, 2104010, "シェフィ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 16002, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 0, "ペコリーヌ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 106001, 0.0, 1, 0, 16003, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 0, "キャル", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 16004, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 17002, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 106001, 0.0, 1, 0, 17004, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 0, "キャル", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 17005, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 2, "2030/12/17 14:59:59", 106401, 0.0, 1, 0, 17006, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, 2104010, "シェフィ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 17007, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 0, "ペコリーヌ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 18001, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 0, "カリン", -363.0);
