INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (3, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 19001, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 0, "カリン", -470.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (4, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 19002, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 0, "カリン", -470.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (5, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 20001, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 0, "カリン", -470.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (6, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 20002, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 0, "カリン", -470.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 106001, 0.0, 1, 0, 21001, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 0, "キャル", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105901, 0.0, 1, 0, 21002, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 0, "コッコロ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 2, "2030/12/17 14:59:59", 106401, 0.0, 1, 0, 21003, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, 2104010, "シェフィ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 105801, 0.0, 1, 0, 21004, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 0, "ペコリーヌ", -363.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 22001, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 0, "カリン", -430.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 22002, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 0, "カリン", -430.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (3, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 23001, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 0, "カリン", -430.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (4, "2015/12/17 15:00:00", 1, "2030/12/17 14:59:59", 190801, 0.0, 1, 0, 23002, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 0, "カリン", -430.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109001, 4.08, 2, 10011, 24001, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 8.0, 0, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109001, 5.0, 2, 10011, 24002, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 8.0, 0, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (3, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109001, 10.11, 2, 10011, 24003, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 8.0, 0, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (4, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109001, 4.0, 2, 10011, 24004, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 8.0, 0, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (5, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109001, 6.0, 2, 10011, 24005, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 8.0, 0, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (6, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109002, 0.0, 1, 10011, 24006, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 0, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (7, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109002, 0.0, 1, 10011, 24007, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 0, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109002, 0.0, 1, 10011, 24008, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 0, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (9, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109002, 0.0, 1, 10011, 24009, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 0, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (10, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109002, 0.0, 1, 10011, 24010, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 0, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109101, 2.12, 2, 10011, 24011, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 8.0, 0, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2019/01/31 12:00:00", 5, "2030/12/17 14:59:59", 109101, 4.19, 2, 10011, 24012, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 8.0, 0, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (3, "2019/01/31 12:00:00", 2, "2030/12/17 14:59:59", 109101, 2.3, 4, 10011, 24013, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 8.0, 0, "シズル（バレンタイン）", -385.0);
