INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (6, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109102, 0.0, 1, 10011, 24016, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 0, "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (7, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109101, 5.01, 2, 10011, 24017, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 8.0, 0, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109102, 0.0, 1, 10011, 24018, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 0, "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (9, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109102, 0.0, 1, 10011, 24019, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 0, "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (10, "2019/01/31 12:00:00", 1, "2030/12/17 14:59:59", 109102, 0.0, 1, 10011, 24020, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 0, "シズル（バレンタイン）", 0.0);
